const { KUCOIN_HOST_COM } = siteCfg;

export function useResponsiveSize() {
  const { sm, lg } = useResponsive();
  if (!sm) return 'sm';
  if (lg) return 'lg';
  return 'md';
}

/**
 * 查询屏幕是否为响应式h5小屏幕 需要在被ThemeProvider 包裹的组件里面使用
 * @returns
 */
export const useIsMobile = (query) => {
  const { sm } = useResponsive();
  return !sm;
};

export const useIsMobileApp = (query) => {
  const mediaMobile = useIsMobile(query);
  const isInApp = JsBridge.isApp();
  return isInApp || mediaMobile;
};

export const useShare = () => {
  const isInApp = JsBridge.isApp();
  const { message } = useSnackbar();
  const referralCode = useSelector((state) => state.user.referralCode, shallowEqual);

  const handleShare = useCallback(() => {
    // 分享必须登陆才能使用
    if (!referralCode) {
      skip2Login();
      return;
    }

    if (!isInApp) return;
    const linkHost = addLangToPath(
      `${
        getShareBaseUrl({ isUseProHost: IS_PROD_ENV })
      }/gemvote?rcode=${referralCode}`,
    );

    if (tenantConfig.showShareDialog) {
      // app 内分享
      trackClick(['main', 'share']);
      JsBridge.open({
        type: 'func',
        params: {
          name: 'share',
          category: 'img',
          needQrCode: true,
          rcode: referralCode, // 可选,ios旧版本有问题，建议加上
          qrCodeUrl: linkHost, // 可选,默认分享注册链接
          linkUrl: linkHost, // 可选,默认分享注册链接
          pic: 'data:image/jpeg;base64,',
        },
      });
    } else {
      copyToClipboard(linkHost);
      message.success(_t('copy.succeed'));
    }
  }, [isInApp, referralCode, message]);

  return handleShare;
};

// init
export const useInitActivityStatus = () => {
  const dispatch = useDispatch();
  const timeRef = useRef(null);
  const pageInfo = useSelector((state) => state.votehub.pageInfo, shallowEqual);

  const { activityStartAt, activityEndAt, voteStartAt, voteEndAt, status } = pageInfo || {};

  /**
   * 生成活动前端业务状态
   * 活动未开始 / 活动结束 -- 0 ,
   * 投票未开始 -- 1 ,
   * 投票进行中 -- 2 ,
   * 投票结束（可能为待公布 和 获胜公布两种情况） -- 3,
   */
  const genActivityStatus = useCallback(
    (time) => {
      let status = 0;

      // 为查到活动信息时返回0
      if (!activityEndAt) {
        status = 0;
      }
      // 前端根据时间判断活动是否结束
      if (moment(activityEndAt).isBefore(time)) {
        status = 0;
      } else if (moment(voteEndAt).isBefore(time)) {
        status = 3;
      } else if (moment(voteStartAt).isBefore(time)) {
        status = 2;
      } else if (moment(activityStartAt).isBefore(time)) {
        status = 1;
      }
      dispatch({
        type: 'votehub/update',
        payload: {
          activityStatus: status,
        },
      });
    },
    [activityStartAt, activityEndAt, voteStartAt, voteEndAt, dispatch],
  );

  useEffect(() => {
    genActivityStatus(moment());
    timeRef.current = setInterval(() => {
      genActivityStatus(moment());
    }, 1000);
    return () => {
      if (timeRef.current) {
        clearInterval(timeRef.current);
      }
    };
  }, [genActivityStatus]);
};

// 计算倒计时
export function useActivityTime() {
  const timeRef = useRef(null);
  const [time, setTime] = useState(moment());
  const pageInfo = useSelector((state) => state.votehub.pageInfo, shallowEqual);

  const { voteStartAt, voteEndAt } = pageInfo || {};

  useEffect(() => {
    if (voteEndAt >= moment()) {
      timeRef.current = setInterval(() => {
        setTime(moment());
      }, 1000);
      return () => {
        if (timeRef.current) {
          clearInterval(timeRef.current);
        }
      };
    }
  }, [voteEndAt]);

  // 投票开始倒计时
  const voteStartTime = useMemo(() => {
    return voteStartAt >= time ? Math.floor((voteStartAt - time) / 1000) : -1;
  }, [voteStartAt, time]);

  // 投票结束倒计时
  const voteEndTime = useMemo(() => {
    return voteEndAt >= time ? Math.floor((voteEndAt - time) / 1000) : -1;
  }, [voteEndAt, time]);

  return {
    voteStartTime,
    voteEndTime,
  };
}
